import axios from "axios"

const API_URL = "https://api.themoviedb.org/3/"

const GetFilter = async () => {
    const { genre } = await axios.get(`${API_URL}/tv/popular`, {
        params: {
            api_key: process.env.REACT_APP_API_KEY
        }
    })
    return genre
}

export default GetFilter
